import { Box, Typography, useTheme, useMediaQuery } from "@mui/material";
import { useNavigate } from "react-router-dom";

const HelpPage = () => {
  const theme = useTheme();
  const navigate = useNavigate();
  const primaryLight = theme.palette.primary.light;
  const isNonMobileScreens = useMediaQuery("(min-width: 1000px)");
  return (
    <Box>
      <Box
        width="100%"
        backgroundColor={theme.palette.background.alt}
        p="1rem 6%"
        textAlign="center"
      >
        <Typography
          fontWeight="bold"
          fontSize="clamp(1rem, 2rem, 2.25rem)"
          color="primary"
          onClick={() => navigate("/home")}
          sx={{
            "&:hover": {
              color: primaryLight,
              cursor: "pointer",
            },
          }}
        >
          Bunker Labs
        </Typography>
      </Box>

      <Box
        width={isNonMobileScreens ? "50%" : "93%"}
        p="2rem"
        m="2rem auto"
        borderRadius="1.5rem"
        backgroundColor={theme.palette.background.alt}
      >
        <Typography fontWeight="500" variant="h1" sx={{ mb: "1.5rem" }}>
          Welcome to Bunker Labs!
        </Typography>
      </Box>
      <Box
        width={isNonMobileScreens ? "50%" : "93%"}
        p="2rem"
        m="2rem auto"
        borderRadius="1.5rem"
        backgroundColor={theme.palette.background.alt}
      >
        <Typography fontWeight="500" variant="h2" sx={{ mb: "1.5rem" }}>
          Mission Statement
        </Typography>
        <Typography fontWeight="100" variant="h5" sx={{ mb: "1.5rem" }}>
          Insert Mission Statement Here
        </Typography>
      </Box>

      <Box
        width={isNonMobileScreens ? "50%" : "93%"}
        p="2rem"
        m="2rem auto"
        borderRadius="1.5rem"
        backgroundColor={theme.palette.background.alt}
      >
        <Typography fontWeight="500" variant="h2" sx={{ mb: "1.5rem" }}>
          Contact Us?
        </Typography>
        <Typography fontWeight="100" variant="h5" sx={{ mb: "1.5rem" }}>
          Insert Pizza Hut's Phone Number
        </Typography>
      </Box>
    </Box>
  );
};

export default HelpPage;
